import React, { Component } from 'react'
import IconButton from '@material-ui/core/IconButton';
import CloseIcon from '@material-ui/icons/Close';
import { Typography } from '@material-ui/core';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { DialogTitle } from '@material-ui/core';


export default class Dialogue extends Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <Dialog onClose={this.props.handleClose} aria-labelledby="customized-dialog-title" open={this.state.showState}>
                <DialogTitle style={{ cursor: 'move' }} id="draggable-dialog-title">
                <i class="fas fa-dog"></i>
                </DialogTitle>
                <DialogContent dividers>
                    <Typography variant="h2" style={{ fontWeight: '600', textAlign: 'center' }} gutterBottom>
                        BINGO!
                    </Typography>
                    <Typography gutterBottom>
                        You have found all the dog squares!
                    </Typography>
                </DialogContent>
                <Button variant="primary" onClick={this.props.handleClose}>Ruff!</Button>
            </Dialog>
        )
    }
}
